import React, { Component, useRef } from "react";
import 'twitch-stream-embed';
import './App.css';


class TwitchView extends Component {
	constructor(props) {
    super(props);

    this.state = {
      muted: true
    };

  }

	render() {
  return (
    <div>
			<twitch-stream channel="ampm_m" setMuted={props.muted} />;
    </div>
  );
	}
}

export default TwitchView;
